import React from 'react';

const Footer=()=>{
    return(
        <>
        <footer class="mainfooter" role="contentinfo">
       
    	<div className="col-md-3">
    		<h4>Follow Us</h4>
            <ul className="social-network social-circle">
             <li><a href="/" className="icoFacebook" title="Facebook"><i class="fa fa-facebook"></i></a></li>
             <li><a href="/" className="icoLinkedin" title="Linkedin"><i class="fa fa-linkedin"></i></a></li>
            </ul>				
		</div>
  
  </footer>
      
      </>
    )
}
export default Footer;
